import React from 'react';

class Reportes extends React.Component{
    render(){
        const sisisi={height:"200px"}
        return(
            <div className="card">
                <div className="container" style={sisisi}>
                    <div >
                        <br></br>
                        <h4>Reporte:</h4>
                        <hr></hr>
                        <h4>SUB TOTAL: S./ {this.props.subtotal}</h4>
                        <h4>IGV(18%): S./ {this.props.subtotal*0.18}</h4>
                        <h4>TOTAL: S./{this.props.subtotal+this.props.subtotal*0.18}</h4>
                    </div>
                </div>
            </div>
        );
    }
}

export default Reportes;
